import React from 'react'
import { useScreenWidth } from './ScreenWidthContext'

// MUI ICONS 
import LocalPhoneIcon from '@mui/icons-material/LocalPhone';

function Footer() {

  const isMobile = useScreenWidth()

  return (
    <div className='footer__container bg-lively-orange text-white flex justify-center w-full'>
      {isMobile ? (
        <div className='mobile__footer flex flex-col justify-center'>
          <div className="footer_logo">
            <h2>The Orange RV</h2>

            <div className="footer__phone flex justify-center">
              <LocalPhoneIcon />
              <a href="#">+1 (888) 888-8888</a>

            </div>
          </div>

          <div className="footer__navlinks">

          </div>
        </div>
      ) : (
        <>
        </>
      )}
    </div>
  )
}

export default Footer
